import {Link} from 'react-router-dom';

/*Navbar */
export default class Navbar extends Component {
    render() {

        return (
<nav className="navbar navbar-expand-sm  navbar-dark">
Home
<Link to='/'></Link>
</nav>
        );
    }

}
